`,(0,n.jsxDEV)(a,{name:"address-input-uncontrolled-demo",children:(0,n.jsxDEV)(e.div,{"data-rehype-pretty-code-fragment":"",children:(0,n.jsxDEV)(e.pre,{"data-language":"tsx","data-theme":"default",__rawString__:`import { AddressInput } from "@/components/ui/address-input"
import { AutocompleteOption } from "@/components/ui/autocomplete"
import { Button } from "@/components/ui/button"
import * as React from "react"

export function AddressInputCustomDemo() {

    return (
        <form
            action="#"
            method="get"
            onSubmit={e => {
                e.preventDefault()
                alert(JSON.stringify(e.currentTarget.elements["address"].value, null, 2))
            }}
            className="space-y-2 w-full"
        >
            <AddressInput
                label="Address"
                name="address"
                apiKey={process.env.NEXT_PUBLIC_GOOGLE_MAPS_API_KEY || ""}
            />
            <Button type="submit" size="sm">Submit</Button>
        </form>
    )
}
